import React from 'react';

function WeatherApp(){
    function GetWeather(){
        fetch("https://api.openweathermap.org/data/2.5/weather?q={Delhi}&appid={f0a7b3fccd6f021b78f97f7f8439c3da}").then((result)=>{
            return result.json().then((response)=>{
                console.log("Weather Fetch from api",response);
            })
        })
    }
    return(
        <div>
            <h1>Weather App</h1>
            <button onClick={GetWeather}>Get Weather</button>
        </div>
    )
}

export {WeatherApp};
